import React from "react";
import MenuBar from "../components/navigations/MenuBar";
import Footer from "../components/navigations/Footer";

import styled from "styled-components";
const Wrap = styled.div`
  display: flex;
  flex: 1 1;
  overflow-x: hidden;
  overflow-y: scroll;
  z-index: 9;

  flex: column;
  min-height: 600vh;
  width: 100%;
`;
const Layout = (props) => {
  return (
    <React.Fragment>
      <MenuBar />

      {props.children}
      <Footer />
    </React.Fragment>
  );
};

export default Layout;
